<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>URL Grid Viewer</title>
    <style>
      body {
        background-color: #121212;
        color: #ffffff;
        font-family: Arial, sans-serif;
        margin: 0;
        padding: 20px;
      }
      #urlInput {
        width: 100%;
        height: 100px;
        background-color: #333333;
        color: #ffffff;
        border: 1px solid #444444;
        border-radius: 4px;
        padding: 10px;
        margin-bottom: 20px;
        font-size: 14px;
      }
      #grid {
        display: grid;
        grid-template-columns: repeat(5, 1fr);
        gap: 10px;
      }
      .grid-item {
        display: flex;
        justify-content: center;
        align-items: center;
        background-color: #1e1e1e;
        border-radius: 4px;
        overflow: hidden;
      }
      .grid-item img,
      .grid-item video {
        max-width: 100%;
        max-height: 100%;
      }
    </style>
  </head>
